selector_to_html = {"a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY9.png\"><img alt=\"../../media/24USB23KEY9.png\" src=\"../../media/24USB23KEY9.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Bassa Velocit\u00e0</span><a class=\"headerlink\" href=\"#id10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Alta Velocit\u00e0<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY.png\"><img alt=\"../../media/24USB23KEY.png\" src=\"../../media/24USB23KEY.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Alta Velocit\u00e0</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY4.png\"><img alt=\"../../media/24USB23KEY4.png\" src=\"../../media/24USB23KEY4.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Velocit\u00e0 Media</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523IFSNO241.png\"><img alt=\"../../media/2523IFSNO241.png\" src=\"../../media/2523IFSNO241.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Modalit\u00e0 Wireless</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bassa Velocit\u00e0<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Abbinamento Uno-Unico<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocit\u00e0 Di Trasmissione Tastiera Ricevitore<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id3\" role=\"doc-backlink\">2</a><span class=\"fn-bracket\">]</span></span>\n<p>\u00c8 valido solo in modalit\u00e0 wireless 2.4G e quando il destinatario riceve normalmente.</p>\n</aside>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/24RF23CH02.png\"><img alt=\"../../media/24RF23CH02.png\" src=\"../../media/24RF23CH02.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Abbinamento Uno-Unico</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/25KB23SP.png\"><img alt=\"../../media/25KB23SP.png\" src=\"../../media/25KB23SP.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Ottieni Velocit\u00e0 Di Trasmissione Tastiera Ricevitore<a class=\"footnote-reference brackets\" href=\"#id4\" id=\"id3\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></a></span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#wireless-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Wireless<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>Questa modalit\u00e0 utilizza il 2. banda di frequenza GHz per la trasmissione di dati e si basa sulla tecnologia di radiofrequenza (RF), che si collega al computer tramite un ricevitore USB e consente allo scanner di muoversi liberamente entro una certa distanza.</p>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Applicabile solo a RF Dongle con FWVerL e versioni precedenti. Si noti che la velocit\u00e0 dello scanner e del ricevitore deve corrispondere, altrimenti potrebbero verificarsi errori durante la trasmissione di codici a barre lunghi.</p>\n</aside>", "a[href=\"#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocit\u00e0 Media<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
